import React, {useState} from 'react'

import {Wrapper} from '../components/Styled';
import LebenslaufItem from '../components/LebenslaufItem';

import styled from "styled-components";

const Container = styled(Wrapper)`
    justify-content:center;
    align-items:center;
`

export default function Lebenslauf() {
    const [active, setActive] = useState(2);

    return (
        <Container>
            <LebenslaufItem active={active === 1} id={1} handleClick={setActive}/>
            <LebenslaufItem active={active === 2} id={2} handleClick={setActive}/>
            <LebenslaufItem active={active === 3} id={3} handleClick={setActive}/>
        </Container>
    )
}
